const App = () => {

  return (
    <>
    <Tooltip padding="" content="in"  color="red" background="blue" className="m-5">

        {/* <NavLink to="/" target="_blank" rel="noreferrer">
        <div className="tool"></div>
          <span className="tooltip">linkedIn
          </span> */}
          <i className="fab fa-linkedin-in" aria-hidden="true"></i>
        {/* </NavLink> */}

    </Tooltip>
    
      
    </>
  );
}

export default App;
